import React from "react";
import styles from "../styles/experienceStyles";
import { withStyles } from "@material-ui/styles";

function experience({ classes }) {
  return (
    <div className={classes.experience}>
      <h1 style={{ fontFamily: "Oswald" }}>EXPERIENCE</h1>

      <h4 className={classes.h4}>
        As a self taught Front-end Web Developer I am a self motivated
        individual, that can work well on an individual basis. From past
        employment I have aquired the skills needed to work on team projects,
        both as a leader and as a team member.
      </h4>
      <h4 className={classes.h4}>
        I am well adept to working closely with clients and working together to
        achive a solution to any problems or request a client may have.
      </h4>
    </div>
  );
}

export default withStyles(styles)(experience);
